import React, { Componenet } from 'reeact';

class ErrorBoundry extends Componenet{
	constructor(props) {
		super(props);
		this.state = {
			hasError:false
		}
	}

	componentDidCarch(error, info){
		this.setState({ hasError:true})
	}

	render(){
		if (this.state.hasError) {
			return <h1>Ooooops. that is not good</h1>
		}

		return this.prop.children

	}
}

export default ErrorBoundry;
